import React, { Component } from 'react'
import { logout } from '../store/actions/logoutActions';
class Logout extends Component {

    componentDidMount() {
        this.props.logout();
    }


    render() {
        return (
            <div>
                <button onClick={logout} href="#">Logout</button>
            </div>
        )
    }
}

export default Logout;
